import { Link, useRouteMatch, Switch, Route } from "react-router-dom";

import Create from "./Create";
function CreateDeck() {
  const { url, path } = useRouteMatch();

  return (
    <>
      <Switch>
        <Route path={path}>
          <Create url={url} />
        </Route>
        <Route></Route>
      </Switch>
    </>
  );
}

export default CreateDeck;
